export const urlAgentsByPage = (baseUrl: string, page: Number) => {
    return baseUrl + '/?page=' + page.toString()
}

export const urlAgentTotal = (subdirectory: string | undefined): string => {
    const baseUrl = "https://www.domain.com.au";
    if (!subdirectory) {
        return baseUrl
    } else {
        if (subdirectory.startsWith(baseUrl) != true) {
            return baseUrl + subdirectory;
        }
        return subdirectory
    }
}


export const urlBySuburb = (suburb: string[]) => {
    return "https://www.domain.com.au/real-estate-agencies/" + suburb[0].replace(' ', '-').toLowerCase() + '-vic-' + suburb[1]
}

